Poradca záhradkára v mesiaci Január - skontrolovať jesennú výsadbu ovocných stromov a viniča - presvetlenie korún ovocných stromov a rez viniča; teplota nemá byť vyššia ako 5°C čítať viac... Poradca záhradkára v mesiaci Február - dokončíme presvetľovací a zmladzovací rez ovocných drevín a krov; pokračujeme v reze viniča - začiatkom mesiaca je možné ešte narezať vrúble pre jarné štepenie spod stromov vyhrabeme zvyšky opadaného lístia a ak nebolo napadnuté chorobami a škodcami dáme ho do kompostu;
..........
orých zelenín vysievame cukrovú kukuricu pre neskorší zber, skoré odrody šalátu hlávkového na predpestovanie sadeníc, čiernu reďkev, vodnicu, čínsku kapustu, špenát na neskorý jesenný zber čítať viac... Poradca záhradkára v mesiaci August - na záhony vysievame reďkovku a zimný šalát , ozimné odrody cibule skoré odrody kalerábu a skoré odrody šalátu - prihrnieme pór, aby mal dlhé vybielené kŕčiky, na rastliny môžeme nastoknúť i papierové tubusy čítať viac... Poradca záhradkára v mesiaci September
